import React,{useState} from "react";


const Calculator =() => {


function number(e){
    console.log(e.target.value);
}

function valueis(e){
    console.log(e.target.value);
}

const [val,setval]=useState("");

const cal =()=>{
    try{
setval(eval(val));
    }catch(error){
        setval("error");

  }
}

const clear =()=>{
    try{
        setval(val.slice(0,-1));
    }catch(error){
setval("");
    }
}





    return(

<div style={{alignItems:'center'}}>

    <div style={{backgroundColor:'black',height:'400px',width:'400px',
                display:'flex',flexDirection:'column',flex:'1',marginLeft:'auto',marginRight:'auto',marginTop:'180px'}}>

                    <div  style={{flex:'0.25'}}>
<input width={'30px'} value={val}
onChange={(e)=>setval(e.target.value)}></input>
                </div>

                <div style={{flex:'0.15'}}>

                    <button value={'C'} onClick={clear} style={{height:'60px',width:'100px',fontSize:'20px'}}>C</button>
                    <button value={'()'} onClick={valueis} style={{height:'60px',width:'100px',fontSize:'20px'}}>()</button>
                    <button value={'%'} onClick={valueis} style={{height:'60px',width:'100px',fontSize:'20px'}}>%</button>
                    <button value={'รท'} onClick={valueis} style={{height:'60px',width:'100px',fontSize:'20px'}}>รท</button>



                </div>

                <div style={{flex:'0.15'}}>

                    <button value={'7'} onClick={(e)=>setval(val + e.target.value)}  style={{height:'60px',width:'100px',fontSize:'20px'}}>7</button>
                    <button value={'8'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>8</button>
                    <button value={'9'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>9</button>
                    <button value={'X'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>X</button>

                </div>

                <div style={{flex:'0.15'}}>

                    <button value={'4'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>4</button>
                    <button value={'5'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>5</button>
                    <button value={'6'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>6</button>
                    <button value={'-'} onClick={(e)=>setval(val + e.target.value)}  style={{height:'60px',width:'100px',fontSize:'20px'}}>โ</button>

                </div>

                <div style={{flex:'0.15'}}>

                    <button value={'1'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>1</button>
                    <button value={'2'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>2</button>
                    <button value={'3'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>3</button>
                    <button value={'+'} onClick={(e)=>setval(val + e.target.value)}  style={{height:'60px',width:'100px',fontSize:'20px'}}>+</button>

                </div>

                <div style={{flex:'0.15'}}>

                    <button value={'0'} onClick={(e)=>setval(val + e.target.value)} style={{height:'60px',width:'100px',fontSize:'20px'}}>0</button>
                    <button value={'00'} onClick={(e)=>setval(val + e.target.value)}style={{height:'60px',width:'100px',fontSize:'20px'}}>00</button>
                    <button value={'.'} onClick={(e)=>setval(val + e.target.value)}  style={{height:'60px',width:'100px',fontSize:'20px'}}>.</button>
                    <button value={'='} onClick={cal}  style={{height:'60px',width:'100px',fontSize:'20px'}}>=</button>

                </div>               


    </div>

</div>

    )
}

export default  Calculator;
